import cv from '../../images/Kseniia-Kurishchenko-cv.pdf'

function CV(): JSX.Element {

    return (
        <div className="main">
            <section className="section">
                <h2 className="main-title">CV</h2>
                <p className="main-text">My CV.pdf should be <a className="link" href={cv} download="presentation"> uploaded </a></p>
            </section>
        </div>
    );
}

export default CV;
